import { useRef } from "react";
import { Component, GlobalStyle, memo ,React, useStore} from "../importAll"


//basic
export const Div  = Component.Create("",(props:IGlobalProps)=>{
    if(!props.Empty)
        return(
            <div 
                className={props.className} 
                style={GlobalStyle(props)} 
                key = {props.myKey}
                onClick={props.onClick}
            >
                {props.children}
            </div>
        ) 
        return <>{props.children}</>; 
})
export const Img  = Component.Create("",(props:IGlobalProps)=><img src={props.bgImg} style={GlobalStyle(props,{width:"100%",height:"auto"})} />)

export const Button = memo((props:IButtonProps)=>{
    let {dispatch,actions} = useStore();
    function GoPage(event:any){
        if(props.toPage)    dispatch(actions.setMainPage(props.toPage))
        if(props.toSubPage) dispatch(actions.setSubPage(props.toSubPage))
        if(props.onClick)   props.onClick(event)
    }
    return <Div Flex border pointer XYcenter onClick={(x:any)=>GoPage(x)} {...props}> {props.value ||""} </Div>
})



export const Grid       = Component.Create("", (props:IGlobalProps) => <Div Grid                  {...props}> {props.children}                     </Div>  )
export const Container  = Component.Create("", (props:IGlobalProps) => <Grid                      {...props}> {props.children}                     </Grid> )
export const Main       = Component.Create("", (props:IGlobalProps) => <Grid                      {...props}> {props.children}                     </Grid> )
export const Footer     = Component.Create("", (props:IGlobalProps) => <Grid                      {...props}> {props.children}                     </Grid> )
export const Nav        = Component.Create("", (props:IGlobalProps) => <Div                       {...props}> {props.children}                     </Div>  )
export const Header     = Component.Create("", (props:IGlobalProps) => <Div                       {...props}> {props.children}                     </Div>  )
export const Aside      = Component.Create("", (props:IGlobalProps) => <Div                       {...props}> {props.children}                     </Div>  )
export const Box        = Component.Create("", (props:IGlobalProps) => <Div                       {...props}> {props.children}                     </Div>  )
export const Icon       = Component.Create("", (props:IGlobalProps) => <Div                       {...props}> {props.children}                     </Div>  )
export const Lable      = Component.Create("", (props:IGlobalProps) => <Div Flex XYcenter         {...props}> {props.children}                     </Div>  )
export const Name       = Component.Create("", (props:IGlobalProps) => <Div Flex XYcenter         {...props}> {props.children}                     </Div>  )
export const Flex       = Component.Create("", (props:IGlobalProps) => <Div Flex                  {...props}> {props.children}                     </Div>  )
export const Copyright  = Component.Create("", (props:IGlobalProps) => <Div Flex XYcenter         {...props}> {props.value ||"כל הזכויות שמורות"} </Div>  )    
export const Menu       = Component.Create("", (props:IMenuProps  ) => <Flex spaceAround XYcenter {...props}> {props.children}</Flex>)
export const Choice     = Component.Create("", (props:IChiceProps ) => <Button  width={"100px"} height={"70%"} styleOverrid={props.selected?props.onSelectedStyle:null} {...props}>{props.value}</Button>)
export const Logo       = Component.Create("", (props:IGlobalProps) => <Img {...props} />)


export const Input  = memo( React.forwardRef( (props:IInputProps,ref:any) =>{
    return(
        <Flex {...props}>
            <Lable height="max-content">{props.value}</Lable>
            <input style={{height: "max-content"}} type={props.type} name={props.name} ref={ref} onChange={props.onChange}/>
            <span className="validation">{props.validMgs}</span>
        </Flex>
    )
}))


interface IButtonProps extends IGlobalProps{
    toPage    ?: AllMainPagesType;
    toSubPage ?: AllSubPagesType;
}

interface IMenuProps extends IGlobalProps{
    onSelected?:React.CSSProperties;
}
interface IChiceProps extends IButtonProps{
    onSelectedStyle?:React.CSSProperties;
    selected? : boolean;
}



interface IInputProps extends IGlobalProps{
    type:string;
    name?:string;
    ref:any;
    validMgs?:any;
}
